import React, { Component } from 'react';

class Navbar extends Component {
    state = {}
    render() {
        return (<nav class="navbar navbar-dark bg-dark">
            <a class="navbar-brand" href="/home">Navbar</a>
        </nav>);
    }
}

export default Navbar;
